var typed = $(".typed");

$(function () {
    var strings = $('.typed-items').text();
    strings = $('.typed-items').data('typed-person') + ',' + strings;
    strings = strings.split(',');

    typed.typed({
        strings: strings,
        typeSpeed: 100,
        loop: true,
    });
});

// ========================================================================= //
//  Owl Carousel Services
// ========================================================================= //

$('.services-carousel').owlCarousel({
    autoplay: true,
    loop: true,
    margin: 20,
    dots: true,
    nav: false,
    responsiveClass: true,
    responsive: {
        0: {
            items: 1
        },
        768: {
            items: 2
        },
        900: {
            items: 4
        }
    }
});
